import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = ({ user, onLogout }) => {
  const [message, setMessage] = useState('');
  const [showMessage, setShowMessage] = useState(false);
  const isAuthenticated = !!user;
  const [logoAnimate, setLogoAnimate] = useState(true);

  const triggerLogoAnimation = () => {
    setLogoAnimate(false);
    setTimeout(() => setLogoAnimate(true), 100);
  };

  const handleLogout = () => {
    onLogout();
    setMessage('You have been logged out.');
    setShowMessage(true);
    setTimeout(() => setShowMessage(false), 3000);
  };

  const handleProtectedClick = (e) => {
    if (!isAuthenticated) {
      e.preventDefault();
      setMessage('Please login first to access this feature.');
      setShowMessage(true);
      setTimeout(() => setShowMessage(false), 3000);
    }
  };

  return (
    <nav className="navbar">
      {showMessage && (
        <div className="custom-message-box">{message}</div>
      )}
      <div className="navbar-inner">
        <div className="navbar-logo-box">
          <Link to="/" onClick={triggerLogoAnimation}>
            <img
              key={logoAnimate ? 'logo-animate' : 'logo-static'}
              src="/S.png"
              alt="SuperMotor Logo"
              className={`navbar-logo${logoAnimate ? ' animate' : ''}`}
            />
          </Link>
        </div>
        <div className="navbar-links">
          {isAuthenticated ? (
            <>
              <Link className="navbar-link" to="/" onClick={triggerLogoAnimation}>Home</Link>
              <Link className="navbar-link" to="/cars" onClick={triggerLogoAnimation}>Buy</Link>
              <Link className="navbar-link" to="/sell" onClick={triggerLogoAnimation}>Sell</Link>
              <Link className="navbar-link" to="/bookings" onClick={triggerLogoAnimation}>My Bookings</Link>
              <Link className="navbar-link" to="/wishlist" onClick={triggerLogoAnimation}>Shortlisted</Link>
              <Link className="navbar-link" to="/orders" onClick={triggerLogoAnimation}>My Orders</Link>
              <Link className="navbar-link" to="/account" onClick={triggerLogoAnimation}>Account</Link>
              <button className="navbar-logout" onClick={handleLogout}>Logout</button>
            </>
          ) : (
            <>
              <Link className="navbar-link" to="/" onClick={triggerLogoAnimation}>Home</Link>
              <Link className="navbar-link" to="/cars" onClick={e => { handleProtectedClick(e); triggerLogoAnimation(); }}>Buy</Link>
              <Link className="navbar-link" to="/sell" onClick={e => { handleProtectedClick(e); triggerLogoAnimation(); }}>Sell</Link>
              <Link className="navbar-link" to="/login" onClick={triggerLogoAnimation}>Login</Link>
            </>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
